import React from "react";
import "./styles.css";
// import FontAwesome from "react-fontawesome";
// import faStyles from "font-awesome/css/font-awesome.css";

import "../../node_modules/font-awesome/css/font-awesome.min.css";
// import Skillsbackground from "./techimages/skillsbackgroundtrans.png";

function Skills() {
  return (
    <div
      id="skills"
      style={MainDiv}
      data-aos="fade-down"
      data-aos-duration="9000"
    >
      <div style={Heading}>
        <div>Skills</div>
      </div>
      <div
        style={{
          backgroundColor: "#F1F2F2",
          padding: "1%",
        }}
      >
        <div className="row" style={Content}>
          <div
            className="container"
            style={{
              display: "flex",
              alignItems: "center",
              justifyContent: "center",
            }}
          >
            <div
              className="card border-0 ProjectCard ml-2 mr-2  mt-2 mb-2"
              data-aos="zoom-in"
              style={{
                position: "relative",
                justifyContent: "center",
                opacity: "0.9",
                backgroundColor: "#EA5D5A",
              }}
            >
              <div>
                {/* <i
                  className="fa fa-desktop mb-3"
                  style={{ fontSize: "90px", color: "rgb(94, 120, 166)" }}
                  aria-hidden="true"
                ></i> */}
                <img alt="frontend" style={{maxWidth:"100%", maxHeight:"100%"}} src={require("../Icons/Icons-01.png")}/>
              </div>
              <div className="mt-3" style={{ color: "white" }}>
                FRONT END
              </div>
              <div
                className="SkillsCardLayover rounded"
                style={{ backgroundColor: "#193964", fontSize: "15px", display:"flex", justifyContent:"center", alignItems:"center"}}
              >
                <ul
                  style={{
                    listStyleType: "none",
                    borderBottom: "1px",
                    textAlign: "center",
                    padding: "0.5rem",
                  }}
                >
                  <li
                    style={{
                      borderBottom: "1px solid #eee",
                      padding: "0.5rem",
                    }}
                  >
                    react | Redux
                  </li>
                  <li
                    style={{
                      borderBottom: "1px solid #eee",
                      padding: "0.5rem",
                    }}
                  >
                    Heroku
                  </li>
                  <li
                    style={{
                      borderBottom: "1px solid #eee",
                      padding: "0.5rem",
                    }}
                  >
                    MySQL
                  </li>
                </ul>
              </div>
            </div>
            <div
              className="card border-0 ProjectCard shadow rounded ml-2 mr-2  mt-2 mb-2"
              data-aos="zoom-in"
              style={{
                justifyContent: "center",
                opacity: "0.9",
                backgroundColor: "white",
              }}
            >
              <div>
                <i
                  className="fa fa-server mb-3"
                  style={{ fontSize: "90px", color: "rgb(94, 120, 166)" }}
                  aria-hidden="true"
                ></i>
              </div>
              <div className="mt-3" style={{ color: "black" }}>
                BACK END
              </div>
              <div
                className="SkillsCardLayover rounded"
                style={{ backgroundColor: "#b3c3de" }}
              >
                <ul
                  style={{
                    listStyleType: "none",
                    borderBottom: "1px",
                    textAlign: "center",
                    padding: "0.5rem",
                  }}
                >
                  <li
                    style={{
                      borderBottom: "1px solid #eee",
                      padding: "0.5rem",
                    }}
                  >
                    react | Redux
                  </li>
                  <li
                    style={{
                      borderBottom: "1px solid #eee",
                      padding: "0.5rem",
                    }}
                  >
                    Heroku
                  </li>
                  <li
                    style={{
                      borderBottom: "1px solid #eee",
                      padding: "0.5rem",
                    }}
                  >
                    MySQL
                  </li>
                </ul>
              </div>
            </div>
            <div
              className="card border-0 ProjectCard shadow rounded ml-2 mr-2  mt-2 mb-2"
              data-aos="zoom-in"
              style={{
                justifyContent: "center",
                opacity: "0.9",
                backgroundColor: "white",
              }}
            >
              <div>
                <i
                  className="fa fa-database mb-3"
                  style={{ fontSize: "90px", color: "rgb(94, 120, 166)" }}
                  aria-hidden="true"
                ></i>
              </div>
              <div className="mt-3" style={{ color: "black" }}>
                DATABASE
              </div>
              <div
                className="SkillsCardLayover rounded"
                style={{ backgroundColor: "#b9c1dd" }}
              >
                <ul
                  style={{
                    listStyleType: "none",
                    borderBottom: "1px",
                    textAlign: "center",
                    padding: "0.5rem",
                  }}
                >
                  <li
                    style={{
                      borderBottom: "1px solid #eee",
                      padding: "0.5rem",
                    }}
                  >
                    react | Redux
                  </li>
                  <li
                    style={{
                      borderBottom: "1px solid #eee",
                      padding: "0.5rem",
                    }}
                  >
                    Heroku
                  </li>
                  <li
                    style={{
                      borderBottom: "1px solid #eee",
                      padding: "0.5rem",
                    }}
                  >
                    MySQL
                  </li>
                </ul>
              </div>
            </div>
            <div
              className="card border-0 ProjectCard shadow rounded ml-2 mr-2  mt-2 mb-2"
              data-aos="zoom-in"
              style={{
                justifyContent: "center",
                opacity: "0.9",
                backgroundColor: "white",
              }}
            >
              <div>
                <i
                  className="fa fa-cloud mb-3"
                  style={{ fontSize: "90px", color: "rgb(94, 120, 166)" }}
                  aria-hidden="true"
                ></i>
              </div>
              <div className="mt-3" style={{ color: "black" }}>
                CLOUD
              </div>
              <div
                className="SkillsCardLayover rounded"
                style={{ backgroundColor: " #bdbdde" }}
              >
                <ul
                  style={{
                    listStyleType: "none",
                    borderBottom: "1px",
                    textAlign: "center",
                    padding: "0.5rem",
                  }}
                >
                  <li
                    style={{
                      borderBottom: "1px solid #eee",
                      padding: "0.5rem",
                    }}
                  >
                    react | Redux
                  </li>
                  <li
                    style={{
                      borderBottom: "1px solid #eee",
                      padding: "0.5rem",
                    }}
                  >
                    Heroku
                  </li>
                  <li
                    style={{
                      borderBottom: "1px solid #eee",
                      padding: "0.5rem",
                    }}
                  >
                    MySQL
                  </li>
                </ul>
              </div>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
}

const MainDiv = {
  marginTop: "70px",
  // height: window.innerHeight,
};

const Heading = {
  justifyContent: "center",
  display: "flex",
  fontWeight: "bold",
  fontSize: "40px",
  fontFamily: "playfair display",
  color: "#193964",
  padding: "3%",
};

const Content = {
  fontWeight: "bold",
  fontSize: "22px",
  fontFamily: "playfair display",
  color: "white",
  margin: "1%",
  padding: "5%",
  // textAlign: "left",
  // display: "inline-block",
};

export default Skills;
